import React from "react";
import ReactDOM from "react-dom";
import "./index.css";


function My(){
  let a=1;
  name="";
  if(a==10){
    name="its me";

  }
  else{
    name="no its not me";
  }
  return 
   <h1>{name}</h1>
  
}


ReactDOM.render(
   
   <div>
   <My />
   <h1>hey broh whats up</h1>
   </div>
   
 ,document.getElementById("root"));
